import React from 'react';
import './ContractsCountTracker.css';

const ContractsCountTracker = ({ contracts }) => {
  const activeContracts = contracts.filter(contract => contract.status === 'Active').length;
  const upcomingContracts = contracts.filter(contract => contract.status === 'Pending').length;
  const completedContracts = contracts.filter(contract => contract.status === 'Completed').length;

  return (
    <div className="contracts-count-tracker">
      <h2>Contracts Count Tracker</h2>
      <div className="count">
        <div className="active">
          <strong>Active:</strong> {activeContracts}
        </div>
        <div className="upcoming">
          <strong>Upcoming:</strong> {upcomingContracts}
        </div>
        <div className="completed">
          <strong>Completed:</strong> {completedContracts}
        </div>
      </div>
    </div>
  );
};

export default ContractsCountTracker;
